variable.html.body:
変数
Rustでは変数宣言にletを使います。
let x = 5;

型アノテーション
Rustは静的な型付言語で、型推論を持っています。
型を明示的に宣言する場合は変数名:の後ろに型名を書きます。
let x: i32 = 1; // i32型の変数xを宣言

可変性
Rustの変数はデフォルトではイミュータブルです。
ミュータブルにしたいならmutを追加します。
let mut x = 1;

変数の初期化
Rustでは未初期化の値を使うことは許されていません。
fn main() {
  let x: i32;
  println!("{}", x); // コンパイルエラー
}

スコープ
変数にはスコープがあります。変数は定義されたブロック内でのみ有効です。 ブロックとは { と } に囲まれた文の集まりです。
fn main() {
    let x = 1;
    {
        let y = 2;
        println!("x:{}, y:{}", x, y);
    }
    println!("x:{}, y:{}", x, y); // エラーyのスコープは切れている
}

シャドーイング
Rustでは変数を覆い隠すことが出来きこれをシャドーイングと言います。後に出てくる同じ名前の変数があるとそれがスコープに入り、以前の変数を上書きします。
let x = 1;
{
    println!("{}", x); // 1
    let x = 2;
    println!("{}", x); // 2
}

こんなこともできます。
let mut x = 1;
x = 2;
let x = x; // xはイミュータブルになります！中身は2です

let y = 3;
let y = "hello"; // yは違う型になりました!

function.html.body:
関数
Rustの関数はfnで定義します。
fn 関数名() {

}

 引数を取る場合
fn print_number(x: i32) {
    println!("{}", x);
}

let と異なり、引数には型アノテーションが必要です。
戻り値がある場合
fn add_one(x: i32) -> i32 {
    x + 1
}

Rustの関数は1つだけ値を返します。->の後戻り値の型を宣言します。  最後の式が戻り値になります。最後にセミコロンがないことに気が付くでしょう。 もしそれを追加すると、こうなります。
fn add_one(x: i32) -> i32 {
    x + 1;
}

エラーが発生します。x + 1;は式ではなく式文だからです。この関数は i32 を返そうとしていますが、セミコロンを付ければ代わりに () を返します。 Rustはこの挙動が求めているものではないと判断し、セミコロンを削除することを提案します。

式と文
Rustは主として式ベースの言語です。 文には2種類しかなく、その他の全ては式です。
式は値を返しますが、文は返しません。Rustには2種類しか文はありません。「宣言文」と「式文」です。 その他の全ては式です。
宣言文
let x = 1;

変数を宣言するletをつかったものが宣言文です。
let は式ではなく文の先頭にしかなりません。
ただし、既に束縛されている変数への割当て
x =2;

は、式です。ただし割当てRustでは割当ての値は空のタプル () です。なぜなら、割り当てられる値には 単一の所有者 しかおらず、他のどんな値を返したとしても予想外の出来事になってしまうからです。
let mut y = 1;
let x = (y = 2);  // xの値は`2`ではなく `()` です！

式文
Rustの文法では文の後には他の文が続くことが期待されています。 式文はそれぞれの式を区切るために;を式の終わりにつけたものです。

ダイバージング関数
Rustはリターンしない関数、「ダイバージング関数」のための特別な構文をいくつか持っています。
fn diverges() -> ! {
    panic!("This function never returns!");
}

panic! マクロは実行中の現在のスレッドを与えられたメッセージとともにクラッシュさせます。 この関数はクラッシュを引き起こすので、決してリターンしません。そのため、それは「ダイバージ」と読む、!型を持つのです。
もし diverges() を呼び出すメイン関数を追加してそれを実行さたら、以下のメッセージが出力さます。
thread ‘’ panicked at ‘This function never returns!’, hello.rs:2
もしもっと情報を得たいと思うのであれば、 RUST_BACKTRACE 環境変数をセットすることでバックトレースを得ることができます。
$ RUST_BACKTRACE=1 ./diverges
RUST_BACKTRACE はCargoの run コマンドでも使うことができます。
$ RUST_BACKTRACE=1 cargo run
ダイバージング関数は任意の型として使うことができます。
let x: i32 = diverges();
let x: String = diverges();

関数ポインタ
関数を指示する変数を作ることもできます。
let f: fn(i32) -> i32;

f は i32 を引数として受け取り、 i32 を返す関数を指示する変数です。
fn plus_one(i: i32) -> i32 {
    i + 1
}
let f: fn(i32) -> i32 = plus_one;
//　let文では型を書く必要はありませんね
let f = plus_one;Run

let x = f(2);
println!("{}", x); // 3;

comment.html.body:
コメント
Rustには行コメント と ドキュメンテーションコメントがあります。
行コメント
行の//以降または/*と*/に挟まれた範囲がコメントです
let x = 5; // コメント！

ドキュメンテーションコメント
ドキュメンテーションコメントは行の///以降または/**と*/に挟まれた間でその中でMarkdown記法をサポートします。
/// 与えられた数値に1を加える
///
/// # Examples
///
/// assert_eq!(6, add_one(5));
/// # fn add_one(x: i32) -> i32 {
/// #     x + 1
/// # }
///
fn add_one(x: i32) -> i32 {
    x + 1
}

もう1つのスタイルのドキュメンテーションコメントに //! があります。これは、その後に続く要素ではなく、それを含んでいる要素（例えばクレート、モジュール、関数）にコメントを付けます。 一般的にはクレートルート（lib.rs）やモジュールルート（mod.rs）の中で使われます。
//! # Rust標準ライブラリ
//!
//! Rust標準ライブラリはポータブルなRustソフトウェアをビルドするために不可欠な
//! ランタイム関数を提供する。

ドキュメンテーションコメントを書いているとき、例を提供することは非常に有用です。
ドキュメンテーションコメントからHTMLドキュメントの生成やコード例をテストとして実行するためには rustdoc ツールを使います。

if.html.body:
if
Rustの式は以下のように書きます
let x = 5;
if x == 5 {
    println!("x は 5 です!");
} else if x == 6 {
    println!("x は 6 です!");
} else {
    println!("x は 5 でも 6 でもありません");
}

Rustのifは文ではなく式なので以下のようなこともできます。
let x = 5;

let y = if x == 5 {
    10
} else {
    15
};

次のように書くこともできます（そして、大抵はこう書くべきです）:
let x = 5;

let y = if x == 5 { 10 } else { 15 }; // y: i32

if式の値は、選択された分岐中の最後の式の値となります。 else のない if では、その値は常に () が期待されます。
let x = 1;
let y = if x == 1 { 2 };　// コンパイルエラー
println!("{}",y);

loop.html.body:
ループ
Rustには３つのループ機構があります。loop, while, forです。
loop
無限 loop です。breakなどをするまでずっとループし続けます。
loop {
    println!("Loop forever!");
}

while
Rustには while ループもあります。
let mut x = 0;
let mut done = false;

while !done {
    x += 1; // x++　としたいところですがRustにはインクリメント演算子とデクリメント演算子はありません！
    println!("{}", x);
    if x % 5 == 0 {
        done = true;
    }
}

for
Rustの for には下記のような構文はありません
for (i = 0; i 
代わりに、このように書きます
for i in 0..10 {
    println!("{}", i);
}

抽象的な用語を使うと
for 変数 in 式 {
    処理
}

式はIntoIteratorを用いてイテレータへと変換可能なアイテムです。
例では、0..10 が開始位置と終了位置をとる式であり、終了位置はその値自身を含まないため、このループは 0 から 9 までを表示します。
列挙
ループ中で何回目の繰り返しかを知る必要があるなら、 .enumerate() 関数が使えます。
レンジを対象に:
for (i,j) in (5..10).enumerate() {
    println!("i = {}, j = {}", i, j);
}

iにループ回数jにレンジの値が入ります。
出力:
i = 0 , j = 5
i = 1 , j = 6
i = 2 , j = 7
i = 3 , j = 8
i = 4 , j = 9
イテレータを対象に:
let lines = "hello\nworld".lines();
for (linenumber, line) in lines.enumerate() {
  println!("{}: {}", linenumber, line);
}

出力:
0: hello
1: world
ループラベル
入れ子のループの時breakやcontinueは最も内側のループに適用されるのがデフォルトですが、外側のループにbreakやcontinueを使いたい場合はラベルを使います。この例は x と y 両方が奇数のときだけ表示します:
'outer: for x in 0..10 {
    'inner: for y in 0..10 {
        if x % 2 == 0 { continue 'outer; } // x のループを継続
        if y % 2 == 0 { continue 'inner; } // y のループを継続
        println!("x: {}, y: {}", x, y);
    }
}

ownership.html.body:
所有権
概要
Rustの特徴であり、Rustの最大の目標、メモリ安全性を得るための方法です。
Rustは「ゼロコスト抽象化」を通じて安全性とスピードという目標を達成しています。「ゼロコスト抽象化」とは抽象化を機能させるためのコストをできる限り小さくすることを意味します。 所有権システムはゼロコスト抽象化の主な例で、解析の全ては コンパイル時に行われるためどの機能に対しても実行時のコストは全く掛かりません。
ただし学習コストは高く慣れるまでなかなかコンパイルが通らないそうです。
所有権
Rustでは変数は所有権を持ち変数がスコープから外れるとき、Rustはリソースを解放します。
fn hoge() {
    let v = vec![1, 2, 3];
}

vがスコープに入るとき、新しい Vec が作られ、ヒープに空間を割り当てます。hoge() の終了時 v がスコープから外れるとき、Rustはベクタに関連するもの全てを取り除きます。それがヒープ割当てのメモリであってもです。
ムーブセマンティクス
Rustでは与えられたリソースに対する変数が 1つだけ です。
let v = vec![1, 2, 3];
let v2 = v;
println!("{}", v[0]); // コンパイルエラー "use of moved value: `v`"

所有権を受け取る関数を定義して、引数として渡した場合でも同じようなことが起きます。
fn take(v: Vec) {
    // ここで何が起きるかは重要ではない
}
let v = vec![1, 2, 3];
take(v);
println!("{}", v[0]); // 同じコンパイルエラー

所有権を何か別のものに転送するとき、参照するものを「ムーブした」と言います。
変数をムーブした後で使うことができない理由を説明します。
let v = vec![1, 2, 3];
let v2 = v;

最初の行はベクタオブジェクトvとそれの含むデータにメモリを割り当てます。 ベクタオブジェクトは スタック に保存され、ヒープに保存された内容[1, 2, 3]へのポインタを持ちます。vをv2にムーブすると、v2にベクタオブジェクトのコピーを割り当てます。このシャローコピーは、実際のデータを含むヒープ割り当てのコピーを作成しません 。それは、ヒープ上のベクタの内容へのポインタが2つあることを意味し、データ競合を引き起こしかねないためRustの安全性保証に違反します。そのため、Rustはムーブを終えた後のvの使用を禁止します。
たとえば、ベクトルをv2から2つの要素に切り捨てた場合、
v2.truncate（2）; // 引数以降のインデックスの要素を削除する

もしvがまだアクセス可能だった場合ヒープデータが切り捨てられていることがわからないため、スタック上のベクトルvの部分は、ヒープ上の対応する部分と一致しません。 vはまだベクトルに3つの要素があると思っていて、実際には存在しない要素v[2]にアクセスする可能性があります、これはセグメンテーションフォルトにつながるか、権限のないユーザーがアクセスできないメモリから読み取ることができるといった不具合につながります。
そのため、Rustはムーブを終えた後のvの使用を禁止します。
Copy型
所有権が別の変数に転送されると、元の変数は使用できません。しかし、この振る舞いを変えるトレイトというものがあり、コピーと呼ばれています。詳しくは後ほど説明しますが今のところは特別な動作を追加する特定のタイプの注釈と考えておきましょう。
let v = 1;
let v2 = v;
println!("{}", v);

この場合、vはi32で、i32はコピートレイトをインプリメントしています。vをv2に代入すると、データのコピーが作成されます。これは、移動とは異なり、vはその後も使用できます。これは、i32には他の場所へのデータへのポインタではないため、コピーは完全なコピーだからです。すべてのプリミティブ型はコピー特性を実装しているため、所有権ルールにしたがって所有権が引き継がれるわけではありません。
fn main() {
    let x = 3;
    let y = x;
    println!("{}", x); // 3
}

独自の Copy 型を作る方法は トレイト セクションで説明します。
所有権移動
もし関数で所有権を返さなければならないのであれば、こうなります。
fn foo(v: Vec) -> Vec {
    // vについての作業を行う
    v // 所有権を返す
}

これは非常に面倒です。もっとたくさんの所有権を受け取れば、それはもっとひどくなります。
fn foo(v1: Vec, v2: Vec) -> (Vec, Vec, i32) {
    // v1とv2についての作業を行う
    (v1, v2, 42) // 所有権と関数の結果を返す
}

let v1 = vec![1, 2, 3];
let v2 = vec![1, 2, 3];

let (v1, v2, answer) = foo(v1, v2);

とても面倒です。これを解決するために次に借用という機能を説明します。

vector.html.body:
ベクタ
ベクタは拡張可能な配列です、標準ライブラリ上で Vec として提供されています。ベクタはデータを常にヒープ上にアロケーションします。 ベクタはvec!マクロを用いて作成できます:
let v = vec![1, 2, 3, 4, 5]; // v: Vec

(以前使ったprintln! マクロと異なり、vec! マクロで 角括弧 [] を利用しました。) Rustではどちらの括弧でも利用可能であり、解りやすさのためです。
vec! には初期値の繰り返しを表現するための形式があります:
let v = vec![0; 10]; // 0が10個

要素へのアクセス
ベクタ中の特定のインデックスの値にアクセスするには [] を利用します。インデックスは 0 から始まります
let v = vec![1, 2, 3, 4, 5];
println!("{}", v[2]); // 3

また、インデックスは usize 型でなければなりません。
let v = vec![1, 2, 3, 4, 5];

let u: usize = 0;
let i: i32 = 0;

println!("{}", v[u]); // 1

println!("{}", v[i]); // コンパイルエラー

イテレーティング
let v = vec![1, 2, 3, 4, 5];
// 所有権なし
for i in &v {
    println!("{}", i);
}
// 所有権あり
for i in v {
    println!("{}", i);
}

ミュータブル参照
let mut v = vec![1, 2, 3, 4, 5];
for i in &mut v {
    println!("{}", i);
}
